soundeffect sound2play; // global variable that tells which sound to play

typedef struct { 
   const unsigned char *wave; //a pointer to the sound samples array
   long length;     // how long the array is
} sound_t;

sound_t sounds[2] ={
	//{mainsong, MainLen},
	{pausebutton, PauseLen},
	{munch, MunchLen}	
};
void Timer0A_Stop(void);
uint32_t pIndex=0;

void playsample(void){
   DAC_Out(sounds[sound2play].wave[pIndex++]);
   if (pIndex >= sounds[sound2play].length){
     Timer0A_Stop();//comment out to have the sound play constantly
     pIndex=0;
   }
}


void playsound(soundeffect sound){
  sound2play = sound;
	Timer0_Init(BusClock/SampleFreq, 3); // 11.025 kHz
}


void Timer0A_Handler(void) {
	TIMER0_ICR_R = TIMER_ICR_TATOCINT;
	playsample();
}
